import React from "react";
import Image from "./chip.JPG";

const donnees=()=>{

}


const Card = (props) => {
  return (
    <div className="card">
        <h1 className="company-name"> {props.CompanyName}</h1>
        <img src ={Image} className="chip-phone" />
        <h1 className="card-number"> {props.CardNumber}</h1>
        <div className="card-superposition">
          <div>
            <h1 className="valid-thru"> {props.ValidThru}</h1>
            <h1 className="card-holder"> {props.CardHolder}</h1>
          </div>
          <div>
          <img className="mastercard" src='https://seeklogo.net/wp-content/uploads/2016/07/mastercard-vector-logo.png' />
          </div>
        </div>
      </div>
  );
};

export default Card;
